svg.script:
 //
    var currentLayer;
    var currentBase = 'map';
    var currentLegend
    var layerO = '0.7'
    function setO(name, O){
	document.getElementById(name).style.opacity = O;
	}
    function highlight(name){
	if(currentLayer != name && currentBase != name) {
		setO("but_"+name, '1');
		}
	}
    function unhighlight(name){
	if(currentLayer != name && currentBase != name) {
		setO("but_"+name, '0');
		}
	}
    function setColour(name, col){
	elem = document.getElementById(name);
	elem.setAttribute("fill", col);
	}
    function toggleLayer(name){
	if(name != currentLayer){
		if(currentLayer){
			setO(currentLayer, '0');
			setO("but_"+currentLayer, '0');
			}
		setO(name, layerO);
		setColour("lab_"+name, "ff0000");
		highlight(name);
		currentLayer = name;
		if(name == 'lulc') {
			if(currentLegend){setO("leg_"+currentLegend, '0')};
			setO('leg_lulc', '1');
			currentLegend = 'lulc';
		} else if(name == 'lc') {
			if(currentLegend){setO("leg_"+currentLegend, '0')};
			setO('leg_lc', '1');
			currentLegend = 'lc';
		} else if(currentLegend != 'es'){
			if(currentLegend){setO("leg_"+currentLegend, '0')};
			setO('leg_es', '1');
			currentLegend = 'es';
			}
	} else {
		setO(name, '0');
		setColour("lab_"+name, "4d4d4d");
		setO("but_"+name, '0');
		setO("leg_"+currentLegend, '0');
		currentLayer = undefined;
		currentLegend = undefined;
		}
	}
    function toggleBase(name){
	if(name != currentBase){
		setO("but_"+currentBase, '0')
		setO("but_"+name, '1')
		setColour("lab_"+currentBase, "#4d4d4d")
		setColour("lab_"+name, "#ff0000")
		setO(currentBase, '0');
		setO(name, '1');
		currentBase = name;
		}
	}


    //
